{"align":"Right","attr":"set","prompt":"","src":"var d=(new Date);
var ymd = "" + (d.getYear()+1900) + "" + (((d.getMonth()+1)>9)? d.getMonth()+1 : "0" + (d.getMonth()+1)) + "01";
var url = encodeURIComponent("http://www.ccee.org.br/csv-precos/pesquisar.do?method=lista&dataInicio=" + ymd + "&dataFim=" + ymd);

setTimeout(function(){
$.get('/htdocs/proxy.php?URL=' + url + '&TYPE=text/plain', function(data){
